('32377719-5e01-4862-a512-f1031169d21d','2e87b3e2-a1f6-4e74-90cf-e8d02fd0d281','04/05/2021','Đèn hành lang bị hỏng','Khu vực hành lang tầng nhà tôi ở đèn bị hỏng gây khó khăn đi lại khi về đêm. Mong bộ phận kỹ thuật xử lý gấp.','','Chờ trả lời'),
('32377719-5e01-4862-a512-f1031169d21d','6485e53c-8fa9-454c-aaa1-66b5cfd66a93','05/05/2021','Thang máy tòa nhà A không hoạt động','Thang máy khu vực tòa nhà nhà A hiện không hoạt động gây bất tiện cho việc đi lại. Mong ban quản lý khắc phục sớm.','','Chờ trả lời'),
('89780db0-ed39-4c08-8bcb-54f3b1ddb7a3','bc465fff-847f-4654-94c1-7c42e5f76040','06/05/2021','Khu vực hành lang tầng 8 tòa B dơ','Khu vực hành lang tầng nhà tôi sống rác nhiều, chai nhựa và cả rác sinh hoạt chưa được nhân viên vệ sinh gom rác hơn 2 ngày qua. Mong BQL nhanh xử lý.','','Chờ trả lời'),
('32377719-5e01-4862-a512-f1031169d21d','9afb289a-3d3f-41b9-952a-b8b05c4913b9','07/05/2021','Nền gạch hành làng tầng 8 bị hỏng','Nền gạch khu vực hành lanh tầng 8 bị bể nhiều chỗ, tiềm ẩn nguy cơ té ngã không an toàn. Mong BQL sớm khắc phục.','','Chờ trả lời'),
('1807ec2a-1d93-4589-846e-2ced74116ec7','569673de-44a5-4b51-b7e0-27a4e21308cc','08/05/2021','Cây xanh khu vực khuôn viên bị ngã','Cây xnah ở khu vực khuôn viên tòa A bị ngã gây mất an toàn, bất tiện đi lại. ','','Chờ trả lời');
